Situação cadastral é a informação que espelha no CNPJ a condição cadastral da inscrição da entidade. As situações cadastrais, perante o CNPJ, enquadram-se em:

• REGISTRO_ATIVO; 
• CANCELADA_ART.60_LEI_8934/94;
• EXTINTA;
• CONVERTIDA_SOC._CIVIL-SIMPLES;
• TRANSFERIDA_PARA_OUTRA_UF;
• FALIDA;
• CANCELADA;
• REGISTRO_ATIVO_PROVISORIO;
• CANCELADA-MEI;

Situação cadastral é a informação que espelha no CNPJ a condição cadastral da inscrição da entidade. As situações cadastrais, perante o CNPJ, enquadram-se em:

• REGISTRO_ATIVO; 
• CANCELADA_ART.60_LEI_8934/94;
• EXTINTA;
• CONVERTIDA_SOC._CIVIL-SIMPLES;
• TRANSFERIDA_PARA_OUTRA_UF;
• FALIDA;
• CANCELADA;
• REGISTRO_ATIVO_PROVISORIO;
• CANCELADA-MEI;


A sociedade é legalmente regida pelos artigos 986 a 990 do Código Civil brasileiro (Lei nº 10.406, de 10 de janeiro de 2002.).

Estado do Envio da Requisição, pode possuir os seguintes valores:

NÃO PRECISA ENVIAR;
PENDENTE DE ENVIO;
ENVIADO COM SUCESSO;
ENVIADO COM ERRO
